import React from 'react';
import styled from 'styled-components';
import Row from 'react-bootstrap/Row'
import Container from 'react-bootstrap/Container'
import {CustomJumbotron} from './components/CustomJumbotron';
import {Footer} from './components/Footer';
import {CustomCard} from './components/CustomCard';
import BackgroundImage from './assets/background.png';


const Styles = styled.div`
    .row {
        margin-left: 0px;
        margin-right: 0px;
        font-family: 'Montserrat', sans-serif;
    }

    .col {
        text-align: center;
    }
`;


export const Events = () => {
    return (
        <Styles>
            <CustomJumbotron>Events</CustomJumbotron>
            <div style = {{ backgroundColor: '#cfcfcf'}}>
                <Container style = {{paddingTop: 30, paddingBottom: 70}} >
                    <Row>
                        <CustomCard subTitle = 'Oct 14, 2019'
                                    title = 'Talk on Long Island, NY'
                                    image = {BackgroundImage}>
                        </CustomCard>
                        <CustomCard subTitle = 'Oct 15, 2019'
                                    title = 'Talk at Queens College, NY'
                                    image = {BackgroundImage}>
                        </CustomCard>
                        <CustomCard subTitle = 'Nov 4, 2019'
                                    title = 'Talk at Washington, DC'
                                    image = {BackgroundImage}>
                        </CustomCard>
                        <CustomCard subTitle = 'Nov 9, 2019'
                                    title = 'Talk at Harvard'
                                    image = {BackgroundImage}>
                        </CustomCard>
                    </Row>
                </Container>
            </div>
            <Footer></Footer>
        </Styles>
    );
}
